let P384_MONTJSCALARMUL_NOIBT_WINDOWS_SUBROUTINE_CORRECT = time prove
 (`!res scalar point n xyz pc stackpointer returnaddress.
        ALL (nonoverlapping (word_sub stackpointer (word 3168),3168))
            [(word pc,LENGTH p384_montjscalarmul_windows_tmc); (scalar,48); (point,144)] /\
        ALL (nonoverlapping (res,144))
            [(word pc,LENGTH p384_montjscalarmul_windows_tmc); (word_sub stackpointer (word 3168),3176)]
        ==> ensures x86
             (\s. bytes_loaded s (word pc) p384_montjscalarmul_windows_tmc /\
                  read RIP s = word pc /\
                  read RSP s = stackpointer /\
                  read (memory :> bytes64 stackpointer) s = returnaddress /\
                  WINDOWS_C_ARGUMENTS [res;scalar;point] s /\
                  bignum_from_memory (scalar,6) s = n /\
                  bignum_triple_from_memory (point,6) s = xyz)
             (\s. read RIP s = returnaddress /\
